import React from 'react';
import {useNavigate} from 'react-router-dom'

const Header = () => {
  return (
    <div className="col-xs-offset-2 col-xs-8">
      <div className="page-header"><h2>React Router Demo</h2></div>
      <button></button>
    </div>
  );
}

export default Header;
